import React, {useState, useEffect} from 'react';

const HomePage = () => {

  let [note, setNotes] = useState([])

  return (
    <div>
        <p>You are looged to the home page</p>
        <ul>
          {note.map(note => (
            <li key={note.id}>
              {note.body}
            </li>
          ))}
        </ul>
    </div>);
};

export default HomePage;
